import React from "react";

const Groceries = (props) => {
  const rows = props.groceries.map((row, index) => {
    return (
      <tr key={index}>
        <td>{row.place}</td>
        <td>{row.amount}</td>
      </tr>
    );
  });
  return <tr>{rows}</tr>;
};

export default Groceries;
